        <>
            <Modal.Header closeButton>Create New Contact.</Modal.Header>
            <Modal.Body>
                <Form onSubmit={handleSubmit}>
                    <Form.Group>
                        <Form.Label>Id</Form.Label>
                        <Form.Control type='text' ref={idRef} required/>
                    </Form.Group>

                </Form>
            </Modal.Body>
        </>
    )
}
